import React from 'react'
import styled from 'styled-components'

const header = styled.div 
` background-color: rgb(237, 126, 126);
color:white;
width:190px;
padding:10px;
font-weight: bold;
font-size: 20px;
margin-top:20px;
border-radius: 5px;
text-align: center;
margin-left:80px;
margin-bottom:20px;`
export default function CatsHeader() {
  return (
    <div className="animal-header">Todays Cat Facts </div>
  )
}
